  CollectorProfileExtraProperty_38864:
    property_name: ABOUT.ME
    property_value: "\"Hello, my name is Deanna Dahlsad, and Iâ€™m a hoarder.\"  (You say, \"Hello, Deanna,\" just like any other support group member. *wink*) \r\n\r\nSo I'm a hoarder, married to another hoarder, and together we also raise little hoarders.  I write at Inherited Values, Kitschy Kitschy Coo, Kitsch Slapped, Things Your Grandmother Knew, and here at Collectors Quest."
    collector_profile_collector_id: CollectorProfile_59
  CollectorProfileExtraProperty_38865:
    property_name: ABOUT.COLLECTIONS
    property_value: "The power of the number of three.  It begins with one thing... but once you have three of something, it's official:  It's a collection.\r\n\r\nSo, while I normally only photograph things that I'm writing about, I'm going to make an effort to get at least 3 things from each (some?) of my collections here.  Wish me luck. *wink*\r\n\r\nSticking to my Rule of Three, I shall give you three interests:  reading, writing and talking.  If you can read about it, write about it, or talk about it, I'm interested in it and can easily start collecting it.  Hence the problem with hoarding.  And not having much time to photograph or catalog."
    collector_profile_collector_id: CollectorProfile_59
  CollectorProfileExtraProperty_38866:
    property_name: ABOUT.NEW_ITEM_EVERY
    property_value: ''
    collector_profile_collector_id: CollectorProfile_59
  CollectorProfileExtraProperty_38867:
    property_name: ABOUT.INTERESTS
    property_value: 'Well, you really shouldn''t get me started... I write ''everywhere'' because many things (nearly anything can) interest me (& therefore I have a lot to say!).'
