  CollectorProfileExtraProperty_41259:
    property_name: ABOUT.ME
    property_value: 'We collected art for 30 years and filled up two houses. We then collected outdoor art. The logical extension of that was collecting rolling sculpture.'
    collector_profile_collector_id: CollectorProfile_644
  CollectorProfileExtraProperty_41260:
    property_name: ABOUT.COLLECTIONS
    property_value: 'Our art collection consists of one-of-a-kind sculpture in wood, metal, glass and fabrics. Our car collection is thematic in that I collect automobiles that are rare and beautiful but have to have the "Continental" name. I even have a boat and bicycles that carry the name.'
    collector_profile_collector_id: CollectorProfile_644
  CollectorProfileExtraProperty_41261:
    property_name: ABOUT.NEW_ITEM_EVERY
    property_value: '5+ times a year'
    collector_profile_collector_id: CollectorProfile_644
  CollectorProfileExtraProperty_41262:
    property_name: ABOUT.INTERESTS
    property_value: 'I am an electrician by trade and lighting is a hobby along with automobile restoration. I spend my winters working on projects and spend my summers traveling to Concours d''Elegance to show our cars.'
    collector_profile_collector_id: CollectorProfile_644
